import React from 'react';
import './App.css';
import Index from './views/Index.jsx'
import{
    BrowserRouter as Router,
    Switch,
    Route
} from 'react-router-dom'
import BuyDetai from "./views/Children/BuyDetai";
function App() {
  return (
      <div className="App">
        <Router>
          <Switch>
              {/*<Route path={"/login"} component={Login}></Route>*/}
              <Route component={BuyDetai} path={"/buyDetai"}></Route>
            <Route path={"/"} component={Index}></Route>
          </Switch>
        </Router>
      </div>
  )
}

export default App;
